import React from "react";

const AllPuppies = (props) => {
    console.log(props)
    return (
        <div>
            <h1>All the puppies!</h1>
            <h2>Name: {props.puppy.name}</h2>
            <p>Breed: {props.puppy.breed}</p>
            <p>Status: {props.puppy.status}</p>
            </div>
    )
}
export default AllPuppies
